function ListGroup() {
  let patterns = ["tua madre", "tua zia", "tua cugina", "tua sorella"];
  patterns = [];
    
  return (
    <>
      <h1>List Group</h1>
      {patterns.length === 0 ? <p>Nun ce sta</p> : null}
      <ul className="list-group">
        {patterns.map((pattern) => (
          <li key={pattern /*pattern.id per api.*/} className="list-group-item">
            {pattern}
          </li>
        ))}
      </ul>
    </>
  );
}

export default ListGroup;
